import React from 'react';
import './App.css';

import Home from './componentes/Home/Home.js';
import SobreMim from './componentes/SobreMim/SobreMim.js';
import CompetenciaComponent from './componentes/Competencia/Competencia.js';
import Servicos from './componentes/Servicos/Servicos.js';
import ProjetosComponent from './componentes/Projetos/Projetos.js';
import Contato from './componentes/Contato/Contato.js';
import Footer from './componentes/Footer/Footer.js';

function App() {
    return (
        <div className="App">
            <Home />
            <main>
                <SobreMim />
                <Competencia />
                <Servicos />
                <Projetos />
                <Contato />
            </main>
            <Footer />
        </div>
    );
}

export default App;
